INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Delivery',NULL,'Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2>\n<h3>Your pack shipment</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
('1','2','1','Dostawa',NULL,'Nasze warunki i zasady dostawy','conditions, delivery, delay, shipment, pack','<div class=\"section\">\n<h2 class=\"heading\">DOSTAWA</h2>\n</div>\n<div class=\"deck-text section\">\n<div class=\"read-more-wrapper\">\n<p>Twoje zamówienie powinno zostać dostarczone w ciągu 2-3 dni roboczych od momentu potwierdzenia wysyłki (dotyczy dostawy standardowej). Koszt dostawy jest doliczany do każdego zamówienia i zależy od wybranej metody. </p>\n<p>Wszystkie opcje dostępne dla danego adresu są wyświetlane na etapie finalizacji zamówienia. </p>\n<p>Zamówienia złożone na stronie polskiego sklepu mogą zostać dostarczone tylko osobom, które ukończyły 18 lat i mieszkają w Polsce.</p>\n</div>\n</div>','dostawa'),
('2','1','1','Legal Notice',NULL,'Legal notice','notice, legal, credits','<h2>Legal</h2>\n<h3>Credits</h3>\n<p>Concept and production:</p>\n<p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>','legal-notice'),
('2','2','1','Polityka prywatności i regulamin',NULL,'polityka prywatności i regulamin','notice, legal, credits','<div class=\"section\">\n<h2 class=\"heading\">ZAANGAŻOWANIE GRUPY H&amp;M W OCHRONĘ PRYWATNOŚCI</h2>\n</div>\n<p><span>Jesteśmy Grupą H&amp;M, spółką powiązaną z H &amp; M Hennes &amp; Mauritz AB i jej markami; <b>H&amp;M</b>, <b>COS</b>, <b>Weekday</b>, <b>Monki</b>, <b>H&amp;M HOME</b>, <b>&amp; Other Stories</b>, <b>Arket </b>oraz <b>Afound</b>. Kiedy robisz u nas zakupy lub korzystasz z jednej z naszych usług, powierzasz nam swoje informacje. Ochrona danych osobowych i Twojej prywatności ma dla Grupy H&amp;M najwyższy priorytet.</span></p>\n<p>Chcemy przekazać Ci jasne i przejrzyste informacje na temat danych osobowych, które gromadzimy, dlaczego są one potrzebne, jak są wykorzystywane i jakie są Twoje prawa w stosunku do nich. </p>\n<p> </p>\n<h2>Zarządzanie danymi osobowymi w Grupie H&amp;M w skrócie</h2>\n<p> </p>\n<ul style=\"list-style-type:square;\">\n<li><b>Kto jest odpowiedzialny za przetwarzanie Twoich danych osobowych?<br /></b>Grupa H&amp;M składa się z różnych marek i podmiotów prawnych, a spółka odpowiedzialna za przetwarzanie Twoich danych osobowych jest zależna od celu, w jakim są one gromadzone. W odniesieniu do każdego celu przetwarzania danych otrzymasz informację o firmie odpowiedzialnej. Będzie to albo szwedzka firma H&amp;M Hennes &amp; Mauritz GBC AB, albo jeden z naszych lokalnych oddziałów. <br /><br /></li>\n<li><b>Dlaczego przetwarzamy Twoje dane osobowe?<br /></b>Wykorzystujemy i przetwarzamy Twoje dane osobowe, aby zapewnić Ci najlepsze wrażenia podczas odwiedzania jednej z naszych witryn internetowych lub sklepów. Przetwarzamy również Twoje dane osobowe na Twoją prośbę, aby móc świadczyć Ci żądane usługi, dostarczyć Twoje zamówienie lub zapewnić Ci wsparcie za pośrednictwem naszej obsługi klienta. <br /><br /></li>\n<li><b>Jakie rodzaje danych osobowych przetwarzamy?<br /></b>Dane osobowe to wszelkiego rodzaju informacje, które można przypisać do Ciebie w sposób bezpośredni lub pośredni. Przykłady danych osobowych, które przetwarzamy, to imię i nazwisko, adres, adres e-mail, numer telefonu, informacje dotyczące płatności oraz zamówienie. Możemy również przetwarzać historię użytkowania, adres IP, identyfikator klubowicza oraz informacje, jakie podajesz podczas kontaktu z naszym działem obsługi klienta.<br /><br /></li>\n<li><b>Gdzie przetwarzamy Twoje dane?<br /></b>Twoje dane osobowe są zasadniczo przechowywane na terenie Twojego kraju lub kraju należącego do UE/EOG, ale mogą być również przekazywane do kraju spoza tego obszaru i przetwarzane w nim. <br /><br /></li>\n<li><b>Komu udostępniamy Twoje dane?<br /></b>W razie potrzeby Twoje dane osobowe mogą być udostępniane w ramach spółek Grupy H&amp;M, dostawcom, podwykonawcom i niezależnym stronom trzecim realizującym określone zadania w naszym imieniu.<br /><br /></li>\n<li><b>Jakie masz prawa?</b><br />Masz prawo dostępu, sprostowania, usunięcia i zapoznania się. W niektórych przypadkach masz również prawo do sprzeciwienia się wykorzystywaniu przez nas Twoich danych lub przeniesienia swoich danych. Jeśli masz konto lub jesteś członkiem programu lojalnościowego, możesz skorzystać z prawa dostępu, przenoszenia i sprostowania na stronach swojego konta. W tym miejscu możesz także usunąć swoje konto. </li>\n</ul>\n<p> </p>\n<p><u>Prosimy o zapoznanie się z naszymi pełnymi zasadami ochrony prywatności, aby dokładnie zrozumieć, w jaki sposób przetwarzamy Twoje dane osobowe i jakie prawa Ci przysługują w związku z nimi.</u></p>','polityka-prywatnosci-i-regulamin'),
