('3','2','1','Zwroty',NULL,'Zasady zwrotów','zwroty, zasady','<h2 class=\"heading\">ZWROTY</h2>\n<div class=\"section\"></div>\n<div class=\"deck-text section\">\n<div class=\"read-more-wrapper\">\n<p>Nietrafiony rozmiar, a może towar nie spełnił Twoich oczekiwań? <b>Wydłużyliśmy zwroty do 45 dni dla zakupów online lub w sklepach stacjonarnych dokonanych między 20.11.2022 a 24.12.2022.</b></p>\n</div>\n</div>\n\n<div class=\"section\">\n<h2 class=\"heading\">ZWROT ZAMÓWIEŃ INTERNETOWYCH</h2>\n</div>\n<p>Niezależnie od tego, czy chcesz zwrócić zamówienie internetowe w sklepie stacjonarnym H&amp;M, czy odesłać je z powrotem, zacznij od zarejestrowania zwrotu. Klubowicze mogą zarejestrować zwrot w zakładce ‘’Moje Konto’’ w aplikacji H&amp;M lub na hm.com. Link do strony z rejestracją zwrotu znajdziesz również w wiadomości e-mail potwierdzającej otrzymanie zamówienia. </p>','zwroty'),
