('4','2','1','O nas',NULL,'Dowiedz się więcej o nas','o nas, informacje, wiecej','<h2>O NAS</h2>\n<p>H&amp;M Group to rodzina marek i firm, które umożliwiają klientom na całym świecie wyrażanie siebie poprzez modę i projektowanie oraz wybieranie bardziej zrównoważonego stylu życia.</p>\n<p>Tworzymy wartość dla ludzi i ogólnie społeczeństwa, dostarczając naszą ofertę dla klientów i rozwijając się, koncentrując się na zrównoważonym i rentownym wzroście.</p>','o-nas'),
