('1914','1','2','Płaszcz z wiatroszczelnego hydrofobowego materiału funkcjonalnego, który ochroni przed lekkim deszczem i wiatrem. Kaptur ze sznurkiem i uszczelnianymi szwami, zapięcie na zatrzaski, po bokach ukośne kieszenie z klapką. Reglanowe rękawy z zatrzaskiem u dołu. Bez podszewki. Płaszcz można łatwo złożyć i spakować do dołączonego woreczka ściąganego sznurkiem. Powierzchnia pokryta warstwą wodoodporną bez fluorowęglowodorów.',NULL,'kurtka-dzinsowa-z-podszewka-z-misia',NULL,NULL,NULL,'Kurtka dżinsowa z podszewką z misia',NULL,NULL,NULL,NULL),
('1915','1','1','Podkreślająca figurę tkaninowa kurtka outdoorowa z dwuwarstwowym kapturem. Stójka, zapięcie na suwak z osłoną brody, z przodu i z tyłu watowanie utrzymujące ciepło. Reglanowy krój rękawów minimalizuje tarcie szwów, a ściągacze z otworem na kciuk utrzymują rękawy w miejscu i dodatkowo ogrzewają nadgarstki i dłonie. Po bokach elastyczne panele zwiększające swobodę ruchów. Z przodu kieszenie z suwakiem. Zaokrąglony dół i nieco dłuższy tył zapewniający wygodne dopasowanie podczas ruchu. Częściowo z podszewką.',NULL,'plaszcz-przeciwdeszczowy-i-wiatroodporny',NULL,NULL,NULL,'Płaszcz przeciwdeszczowy i wiatroodporny',NULL,NULL,NULL,NULL),
